import React, { Component } from 'react';
import meandjo from "./images/meandjo.jpg";

export default class HomePage extends Component {
  render() {
    return (
      <div>
          <img src={meandjo} alt="My sister and I"></img>
          <h1>Hello, my name is Sherin!</h1>
      </div>
    )
  }
}
